// Used to redraw the SVG whenever new content is going to be provided.
function redrawSvg(innerContent) {
    document.getElementById(targetInsertElement).innerHTML = `
        <svg xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink"
         viewBox="0 0 ${CANVAS_WIDTH.toString()} ${CANVAS_HEIGHT.toString()}" id="mosaic-svg-rendering"
         style="margin:0 auto;padding:0;display:block;width:100%;height:100%;max-height:800px;"
         preserveAspectRatio="xMidYMid meet" title="Shatter mosaic art.">
            ${innerContent}
        </svg>
    `;
    //// Reference to an external method that's called on window resize events
    if(typeof resizeFunc === "function") { resizeFunc(); }
}




// Start "main".
//// Get the exact time the script was loaded.
var loadedTime = (new Date()).getTime();
// alert("BEGIN: " + ((loadedTime - window.performance.timing.loadEventEnd)/1000).toString()+"s");
//// Set up the SVG properties.
console.log("Loading SVG...");
initialSetup();
//// Initial rendering.
redrawSvg(renderedSVG.map((i)=>{return i.text;}));
//// Register the script-wide resize handler.
var globalResizeTimeoutId;
window.addEventListener('resize', () => {
    window.clearTimeout(globalResizeTimeoutId);
    globalResizeTimeoutId = window.setTimeout(() => {
        // Use the globally-set variable to re-render the current SVG contents.
        let t = document.getElementsByTagName('animateTransform');
        for(let x = 0; x < t.length; x++) {
            if(windEnabled === true && t[x].parentElement.parentElement.id === 'mosaic-svg-rendering') {
                t[x].setAttributeNS(null, 'to',
                    `${Math.max(1000, window.innerWidth+getRand(50,150)).toString()} ` +
                    `${t[x].getAttribute('to').split(' ')[1]}`);
            } else if(windEnabled === true && t[x].parentElement.parentElement.id === 'windy-particle-svg') {
                // Set the particle's properties to expand or shrink its bounds to just outside the window.
                //   This method doesn't RESPAWN the circle, rather it moves its targets to fit the window.
                let currFrom = t[x].getAttribute('from').split(' ');
                let currTo   = t[x].getAttribute('to').split(' ');
                let newFromX, newToX, newFromY, newToY;
                // if(parseInt(currFrom[0]) > 0) {
                    newFromX = getRand(-100, -20);
                    newToX = window.innerWidth + getRand(20,80);
                // } else { newFromX = currFrom[0]; newToX = currTo[0]; }
                // if(parseInt(currFrom[1]) > window.innerHeight) {
                    newFromY = getRand(-20, window.innerHeight+20);
                    newToY = newFromY + getRand(-50, 50);
                // } else { newFromY = currFrom[1]; newToY = currTo[1]; }
                // Finally, set the object's new attributes.
                t[x].setAttributeNS(null, 'from', `${newFromX} ${newFromY}`);
                t[x].setAttributeNS(null, 'to', `${newToX} ${newToY}`);
            }
        }
    }, 500);
});
